import React, { Component } from 'react';
import Bar from './Bar'
import './Login.css'


class Addmin extends Component {
    render() {
        return (
            <div className="BGL">
                <Bar/>
                <br/><br/>
            </div>
        );
    }

}
export default Addmin;
